import React, { Component } from 'react'
import decode from 'jwt-decode'


export default class Valid extends Component {

    constructor(props){
        super(props)

        this.state = {}
    }

    componentDidMount(){
        this.getSession()
    }

    getSession = () => {

        var session = localStorage.getItem('session')
        console.log(session)
        console.log(decode)

    }


    render() {
        return (
            <div>
                {this.props.children}
            </div>
        )
    }
}
